{"operationName":"products","variables":{"productIds":["30044867","30044910","30046729","30046728","30046134","30046139","30046138","30046137","30046514","30046725"]},"query":"query products($productIds: [String]!) {
  products(productIds: $productIds) {
    productId
    name {
      cyrillic
      latin
      __typename
    }
    rating {
      star
      count
      __typename
    }
    media {
      images {
        key
        urls
        __typename
      }
      __typename
    }
    features {
      main {
        name
        value
        __typename
      }
      energyEfficiency {
        name
        value
        __typename
      }
      __typename
    }
    brand {
      name
      __typename
    }
    categories {
      id
      name
      __typename
    }
    __typename
  }
}
"}
